  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0131987 includes physical
  and underway data collected aboard the MELVILLE during cruise MV1306 in the North
  Pacific Ocean from 2013-05-08 to 2013-06-01. These data include CURRENT SPEED -
  EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments
  used to collect these data include ADCP and GPS. These data were collected by Sabine
  Mecking of University of Washington, and by University of California - San Diego;
  Scripps Institution of Oceanography as part of Climate Variability and Predictability
  (CLIVAR) P02E. The Lamont-Doherty Earth Observatory (LDEO) submitted these data
  to NODC as part of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe
  ADCP data represent the raw and automated processed data set. Post processed quality
  assessed data are not available in this accession.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
